    raised by the MA Party Victory Fund. The committee may not have received its share
    of the proceeds as of the end of the reporting period. The committee expects to
    receive transfers at some point in the three months following this reporting period.
    ASDC transfers:  The transfer of the joint fundraising proceeds received during
    this reporting period from the ASDC Partnership Program represents the committee's
    share of proceeds for contributions received during this or prior reporting periods.
    The memo entries for these contributions are included in this or a prior report
    of the committee.  Payments for goods and services:  Payments from organizations
    for the Massachusetts Democratic Party voter file are for the usual and normal
    charge based on market research and enhancements made to the file.  Reimbursements
